import { Heart, Github, Twitter, Linkedin, Mail } from "lucide-react";

const Footer = () => {
  return (
    <footer 
      className="footer-container border-t backdrop-blur-xl"
      style={{
        backgroundColor: "var(--bg-card)",
        borderColor: "var(--border-divider)",
        boxShadow: "var(--shadow-card)",
      }}
    >
      {/* Main Footer Content */}
      <div className="px-6 py-4 flex flex-col md:flex-row items-center justify-between gap-4">
        {/* Left: Branding & Copyright */}
        <div className="flex items-center gap-2">
          <div 
            className="w-7 h-7 rounded-lg flex items-center justify-center font-bold text-sm shadow-md"
            style={{
              background: "linear-gradient(135deg, var(--accent-primary) 0%, var(--accent-secondary) 100%)",
              color: "#020617",
            }}
          >
            T
          </div>
          <div className="flex items-center gap-1.5 text-sm">
            <span style={{ color: "var(--text-muted)" }}>
              © {new Date().getFullYear()} Talkify
            </span>
            <span style={{ color: "var(--border-main)" }}>•</span>
            <span className="flex items-center gap-1" style={{ color: "var(--text-muted)" }}>
              Made with 
              <Heart 
                size={14} 
                className="heart-beat" 
                style={{ color: "var(--danger)" }}
                fill="var(--danger)"
              />
            </span>
          </div>
        </div>

        {/* Center: Quick Links */}
        <div className="hidden md:flex items-center gap-6 text-xs">
          <a 
            href="/privacy" 
            className="footer-link"
            style={{ color: "var(--text-muted)" }}
          >
            Privacy Policy
          </a>
          <a 
            href="/terms" 
            className="footer-link"
            style={{ color: "var(--text-muted)" }}
          >
            Terms of Service
          </a>
          <a 
            href="/help" 
            className="footer-link"
            style={{ color: "var(--text-muted)" }}
          >
            Help Center
          </a>
          <a 
            href="/about" 
            className="footer-link"
            style={{ color: "var(--text-muted)" }}
          >
            About Us
          </a>
        </div>

        {/* Right: Social Links */}
        <div className="flex items-center gap-2">
          <a
            href="https://github.com"
            target="_blank"
            rel="noopener noreferrer"
            className="social-icon"
            aria-label="GitHub"
            style={{
              color: "var(--text-muted)",
              backgroundColor: "var(--bg-input)",
            }}
          >
            <Github size={16} />
          </a>
          <a
            href="https://twitter.com"
            target="_blank"
            rel="noopener noreferrer"
            className="social-icon"
            aria-label="Twitter"
            style={{
              color: "var(--text-muted)",
              backgroundColor: "var(--bg-input)",
            }}
          >
            <Twitter size={16} />
          </a>
          <a
            href="https://linkedin.com"
            target="_blank"
            rel="noopener noreferrer"
            className="social-icon"
            aria-label="LinkedIn"
            style={{
              color: "var(--text-muted)",
              backgroundColor: "var(--bg-input)",
            }}
          >
            <Linkedin size={16} />
          </a>
          <a
            href="mailto:contact@talkify.com"
            className="social-icon"
            aria-label="Email"
            style={{
              color: "var(--text-muted)",
              backgroundColor: "var(--bg-input)",
            }}
          >
            <Mail size={16} />
          </a>
        </div>
      </div>

      {/* Mobile Quick Links */}
      <div className="md:hidden px-6 pb-3 flex items-center justify-center gap-4 text-xs border-t pt-3"
        style={{ borderColor: "var(--border-divider)" }}
      >
        <a 
          href="/privacy" 
          className="footer-link"
          style={{ color: "var(--text-muted)" }}
        >
          Privacy
        </a>
        <span style={{ color: "var(--border-main)" }}>•</span>
        <a 
          href="/terms" 
          className="footer-link"
          style={{ color: "var(--text-muted)" }}
        >
          Terms
        </a>
        <span style={{ color: "var(--border-main)" }}>•</span>
        <a 
          href="/help" 
          className="footer-link"
          style={{ color: "var(--text-muted)" }}
        >
          Help
        </a>
        <span style={{ color: "var(--border-main)" }}>•</span>
        <a 
          href="/about" 
          className="footer-link"
          style={{ color: "var(--text-muted)" }}
        >
          About
        </a>
      </div>

      <style jsx>{`
        .footer-container {
          position: relative;
          overflow: hidden;
        }

        /* Subtle animated gradient overlay */
        .footer-container::before {
          content: '';
          position: absolute;
          top: 0;
          left: -100%;
          width: 100%;
          height: 1px;
          background: linear-gradient(
            90deg,
            transparent,
            var(--accent-secondary),
            transparent
          );
          animation: shimmer 8s linear infinite;
        }

        @keyframes shimmer {
          0% {
            left: -100%;
          }
          100% {
            left: 100%;
          }
        }

        .footer-link {
          position: relative;
          transition: all 0.2s ease;
          text-decoration: none;
        }

        .footer-link::after {
          content: '';
          position: absolute;
          bottom: -2px;
          left: 0;
          width: 0;
          height: 1px;
          background: var(--accent-secondary);
          transition: width 0.3s ease;
        }

        .footer-link:hover {
          color: var(--text-main) !important;
        }

        .footer-link:hover::after {
          width: 100%;
        }

        .social-icon {
          display: flex;
          align-items: center;
          justify-content: center;
          width: 32px;
          height: 32px;
          border-radius: 8px;
          transition: all 0.2s ease;
          text-decoration: none;
          border: 1px solid var(--border-main);
        }

        .social-icon:hover {
          background: linear-gradient(135deg, var(--accent-primary) 0%, var(--accent-secondary) 100%) !important;
          color: #020617 !important;
          transform: translateY(-2px);
          box-shadow: 0 4px 12px rgba(34, 197, 94, 0.3);
          border-color: transparent;
        }

        .social-icon:active {
          transform: translateY(0);
        }

        .heart-beat {
          animation: heartBeat 1.5s ease-in-out infinite;
        }

        @keyframes heartBeat {
          0%, 100% {
            transform: scale(1);
          }
          10%, 30% {
            transform: scale(1.1);
          }
          20%, 40% {
            transform: scale(1);
          }
        }

        /* Responsive adjustments */
        @media (max-width: 768px) {
          .footer-container {
            text-align: center;
          }
        }
      `}</style>
    </footer>
  );
};

export default Footer;
